    public static ArrayList<Long> maximum(ArrayList<Long> arr, long k) {
        // Sort the array in descending order
        Collections.sort(arr, Collections.reverseOrder());
        // Create a new array list to store the maximum k numbers
        ArrayList<Long> result = new ArrayList<>();
        // Add the first k numbers to the result array list
        for (int i = 0; i < k; i++) {
            result.add(arr.get(i));
        }
        // Sort the result array list in ascending order
        Collections.sort(result);
        return result;

