        // Check if the file's name contains more than three digits
        int digit_count = 0;
        for (int i = 0; i < file_name.length(); i++) {
            if (Character.isDigit(file_name.charAt(i))) {
                digit_count++;
            }
        }
        if (digit_count > 3) {
            return "No";
        }

        // Check if the file's name contains exactly one dot
        int dot_count = 0;
        for (int i = 0; i < file_name.length(); i++) {
            if (file_name.charAt(i) == '.') {
                dot_count++;
            }
        }
        if (dot_count != 1) {
            return "No";
        }

        // Check if the substring before the dot is not empty and starts with a letter
        String[] parts = file_name.split("\\.");
        String before_dot = parts[0];
        if (before_dot.isEmpty() || !Character.isLetter(before_dot.charAt(0))) {
            return "No";
        }

        // Check if the substring after the dot is one of the allowed extensions
        String after_dot = parts[1];
        if (!after_dot.equals("txt") && !after_dot.equals("exe") && !after_dot.equals("dll")) {
            return "No";
        }

        // If all conditions are met, return "Yes"
        return "Yes";

