    // (new ArrayList<Long>(Arrays.asList()))
    public static ArrayList<Long> orderByPoints(ArrayList<Long> nums) {
        ArrayList<Pair<Long, Integer>> pairs = new ArrayList<>();
        for (int i = 0; i < nums.size(); i++) {
            long num = nums.get(i);
            int sum = 0;
            while (num != 0) {
                sum += num % 10;
                num /= 10;
            }
            pairs.add(new Pair<>(nums.get(i), sum));
        }
        Collections.sort(pairs, (a, b) -> {
            if (a.getValue1() != b.getValue1()) {
                return a.getValue1() - b.getValue1();
            } else {
                return nums.indexOf(a.getValue0()) - nums.indexOf(b.getValue0());
            }
        });
        ArrayList<Long> result = new ArrayList<>();
        for (Pair<Long, Integer> pair : pairs) {
            result.add(pair.getValue0());
        }
        return result;

