    public static long getMaxTriples(long n) {
        long count = 0;
        for (long i = 1; i <= n; i++) {
            for (long j = i + 1; j <= n; j++) {
                for (long k = j + 1; k <= n; k++) {
                    long sum = i * i - i + 1 + j * j - j + 1 + k * k - k + 1;
                    if (sum % 3 == 0) {
                        count++;
                    }
                }
            }
        }
        return count;

